CREATE TABLE IF NOT EXISTS etchers_data (
  run_order int NOT NULL,
  unit text NOT NULL,
  particle_count int ,
  particle_count_upper_limit int ,
  si_etch_rate numeric ,
  si_etch_rate_upper_limit numeric ,
  si_etch_rate_lower_limit numeric ,
  gas_ar_flow numeric ,
  gas_cl2_flow numeric ,
  gas_o2_flow numeric ,
  gas_ch3f_flow numeric ,
  rf_power numeric ,
  chamber_pressure numeric ,
  trench_width numeric ,
  trench_width_lower_limit numeric ,
  trench_width_upper_limit numeric ,
  trench_depth_lower_limit numeric ,
  trench_depth_upper_limit numeric ,
  trench_depth numeric ,
  warning_abort text ,
  tool_log text
);

